import React from 'react'
import MaterialTable from 'material-table'

export const Table=()=>{
    const data =[
        {name: 'ramesh',age:12},
        {name: 'viki',age:15},
        {name: 'julia',age:18},
        {name: 'margarita',age:22}
    
    ]
    const columns=[
        {
            title:'Nombre',field: 'name'
        },
        {
            title:'Edad',field: 'age'
        }
    ]
    return(<div>
        <MaterialTable title="Material Table"
        data={data}
        columns={columns}
        options={{
            search:true,
            paging:true,
        }}
        />     
        </div>)
}

